import React, { Component } from 'react'

export default class Historia extends Component {
    render() {
        return (
            <div class="carousel-item col-12 col-sm-6 col-md-4 col-lg-3 active rounded">
                <img src="https://i.pinimg.com/originals/03/33/21/033321112df5d5a0392082517cbe5143.jpg" class="img-fluid mx-auto d-block" alt="img1" />
            </div>

        )
    }
}
